import React from 'react';
import ReactWordcloud from 'react-wordcloud';
import {User, Repo} from './github';

interface Wordcloudprops {
  userData: User;
}

const words = [
  { text: 'Lorem', value: 13 },
  { text: 'ipsum', value: 15 },
  { text: 'dolor', value: 20 },
];

const options = {
  // Add options for customization
};

type Props ={

}
const Wordcloud: React.FC<Wordcloudprops>= ({userData}) => {

  //Wordcloud is of the React functional component type
  //you can have only one export default function Github() { ... }  but multiple components like const Wordcloud: React.FC = () => { ... }

  return (
    <div>
      <div style={{ width: '800px', height: '600px' }}>
        <ReactWordcloud words={words} options={options} />
      </div>
      <div>
        {userData.name}
      </div>
    </div>
  );
};
export default Wordcloud;
